	('a3788fae-a0ae-4e61-94a4-db1d7b26cda7', 'Mirziyod  Vasiljonovich', 'tta2005@mail.ru', '+99871 150-97-76', 'Revmatolog', 10, '', '', '', true, true, 10, '2025-09-26 04:31:35.085769+00', '2025-09-26 04:31:35.085769+00'),
	('81c6352c-6446-4749-be32-8422e7688ef3', 'Mirahmedova Hilola To''xtasinovna', 'Hilola_mirahmedova@mail.ru', '+998 55 517 04 24', 'Revmatologiya', 24, '1997-1999 yillarda 2-Toshkent Davlat tibbiyot instituti ixtisoslashtirilgan artrologiya markazida artrolog.2019 yildan hozirgacha  TMA 1-son ichki kasalliklar propedevtikasi kafedrasi mudiri.', '', '{dotsent}', true, true, 12, '2025-09-26 04:31:35.085769+00', '2025-09-26 04:31:35.085769+00'),
	('478d5be2-81c1-4878-b66e-b3ad63ad1248', 'Dildora Abdumalikovna Nabiyeva', 'tta2003@mail.ru', '+99871 150 97 76', 'Revmatologiya', 26, 'TMA 1 fakultet va gospital terapiya kafedrasi dotsenti, fan nomzodi. 1997 yilda Ikkinchi Toshkent tibbiyot institutini davolash yonalishi boyicha tamomlagan. 75 ta ilmiy ish, shu jumladan 4 ta oquv-uslubiy qollanma muallifi. 2003 yilda Keksa yoshdan boshlab revmatoid artritning diagnostikasi va davolash xususiyatlari mavzusida nomzodlik dissertatsiyasini himoya qildi. Asosiy ilmiy yo''nalish: Qonning turli seroz tizimi bilan og''rigan bemorlarda ankiloz spondiloartritning klinik kechishi va davolash. 2012 yildan kafedraning oquv ishlariga masul.', '', '{dotsent}', true, true, 11, '2025-09-26 04:22:26.147823+00', '2025-09-26 04:22:26.147823+00');
