	('b1a6bff5-e395-45c5-a3ab-55cf996484dd', 'Azizbek Karimov', 25, 'Revmatoyid artrit', 'Azizbek Karimov 25 yoshda, u bogimlarda doimiy ogriq va shish sababli shifokorga murojaat qilgan. Tekshiruv natijasida unga revmatoyid artrit tashxisi qoyilgan. Dastlabki oylar ogriqlar kuchli bolgan, lekin muntazam davolash jarayonidan song ahvoli yaxshilana boshlagan.', '6', 'Hozirgi kunda bemor ogriqlari ancha kamaygan, harakatlanish imkoniyati kengaygan.', 'Mirziyod  Vasiljonovich', NULL, true, 40, '2025-09-28 11:21:56.657052+00', '2025-09-28 11:21:56.657052+00', 'text', true, 'The patient reduced salt and fat intake, performs regular light exercises, and has established a healthy sleep routine.', '{"Bogim ogrigi","Shish va qizarish","Ertalabki qotib qolish"}', '{"Dorivor terapiya","Fizioterapiya mashgulotlari","Soglom ovqatlanish"}', '{Metotreksat,"Yalliglanishga qarshi preparatlar","Ogriq qoldiruvchi vositalar"}', 4, 'Revmatoyid artrit: 25 yoshli bemor hikoyasi', '25 yoshli bemor Azizbek Karimovning revmatoyid artrit tashxisi, davolash jarayoni va ijobiy natijalari haqida qisqa hikoya.', NULL);
